import React from "react";
import "./Footer.css";
import { Container, Row, Col, ListGroup, ListGroupItem } from "reactstrap";
import { Link } from "react-router-dom";
import logo from "../../assets/images/logo.png";

const quick__links = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/about",
    display: "About",
  },
  {
    path: "/tours",
    display: "Tours",
  },
];
const quick__links2 = [
  {
    path: "/login",
    display: "Login",
  },
  {
    path: "/register",
    display: "Register",
  },
];

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          {/* Logo and Company Info */}
          <Col lg="3" md="6" sm="12">
            <div className="footer__logo">
              <img src={logo} alt="Logo" className="mb-3" />
              <p>
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus
                non arcu tincidunt, feugiat velit at, suscipit leo.
              </p>
              <div className="social__links d-flex align-items-center gap-3">
                <Link to="#">
                  <i className="ri-youtube-line"></i>
                </Link>
                <Link to="#">
                  <i className="ri-instagram-line"></i>
                </Link>
                <Link to="#">
                  <i className="ri-twitter-line"></i>
                </Link>
                <Link to="#">
                  <i className="ri-facebook-line"></i>
                </Link>
              </div>
            </div>
          </Col>

          {/* Quick Links 1 */}
          <Col lg="3" md="6" sm="6">
            <h5 className="footer__title">Quick Links</h5>
            <ListGroup className="footer__list">
              {quick__links.map((item, index) => (
                <ListGroupItem key={index} className="p-0 mb-2">
                  <Link to={item.path} className="footer__link">
                    {item.display}
                  </Link>
                </ListGroupItem>
              ))}
            </ListGroup>
          </Col>

          {/* Quick Links 2 */}
          <Col lg="3" md="6" sm="6">
            <h5 className="footer__title">User Links</h5>
            <ListGroup className="footer__list">
              {quick__links2.map((item, index) => (
                <ListGroupItem key={index} className="p-0 mb-2">
                  <Link to={item.path} className="footer__link">
                    {item.display}
                  </Link>
                </ListGroupItem>
              ))}
            </ListGroup>
          </Col>

          {/* Contact Information */}
          <Col lg="3" md="6" sm="12">
            <h5 className="footer__title">Contact Us</h5>
            <ListGroup className="footer__list">
              <ListGroupItem className="p-0 mb-2">
                <i className="ri-map-pin-line"></i> 123 Street, City, Country
              </ListGroupItem>
              <ListGroupItem className="p-0 mb-2">
                <i className="ri-phone-line"></i> +123 456 7890
              </ListGroupItem>
              <ListGroupItem className="p-0 mb-2">
                <i className="ri-mail-line"></i> info@wanderlust.com
              </ListGroupItem>
            </ListGroup>
          </Col>
        </Row>
        <Row className="mt-4">
          <Col lg="12" className="text-center">
            <p className="footer__copyright">
              &copy; {new Date().getFullYear()} WanderLust. All Rights Reserved.
            </p>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;

